rray","links":[11]}],"configuration":{"sql":"SELECT rk.RKUNIT_NAMA, ru.RUNIT_NAMA, SUM(tuh.GROSS) GROSS, SUM(tuh.NET) NET, tf.RFOC_KODE, rf.RFOC_NAMA, rf.RJFOC_KODE, rf.SATUAN, rj.RJFOC_NAMA, SUM(tf.TFOC_PEMAKAIAN) TFOC_PEMAKAIAN, SUM(tfr.TFOC_REF_NKALOR) TFOC_REF_NKALOR FROM T_UPRODUKSI_HARIAN tuh JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tuh.RDISTRIK_KODE AND rk.RKUNIT_KODE = tuh.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = tuh.RDISTRIK_KODE AND ru.RKUNIT_KODE = tuh.RKUNIT_KODE AND ru.RUNIT_KODE = tuh.RUNIT_KODE JOIN T_FOC tf ON tf.RDISTRIK_KODE = tuh.RDISTRIK_KODE AND tf.RKUNIT_KODE = tuh.RKUNIT_KODE AND tf.RUNIT_KODE = tuh.RUNIT_KODE JOIN T_FOC_REF tfr ON tfr.RDISTRIK_KODE = tuh.RDISTRIK_KODE AND tfr.RKUNIT_KODE = tuh.RKUNIT_KODE AND tfr.RUNIT_KODE = tuh.RUNIT_KODE AND tfr.RFOC_KODE = tf.RFOC_KODE JOIN R_FOC rf ON rf.RFOC_KODE = tf.RFOC_KODE JOIN R_JFOC rj ON rj.RJFOC_KODE = rf.RJFOC_KODE WHERE tuh.RDISTRIK_KODE = :rdistrik_kode AND tuh.TUPROD_TGL BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') GROUP BY rk.RKUNIT_NAMA, ru.RUNIT_NAMA, tf.RFOC_KODE, rf.RFOC_NAMA, rf.RJFOC_KODE, rf.SATUAN, rj.RJFOC_NAMA, tfr.TFOC_REF_THN, tfr.TFOC_REF_BLN;"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":5,"type":"case/report-tuproduksi","pos":[850,280],"size":{"0":210,"1":78},"flags":{},"order":4,"mode":0,"inputs":[{"name":"data","type":"array","link":12},{"name":"is_export","type":"boolean","link":null}],"outputs":[{"name":"result","type":"array","links":[13,19]},{"name":"export","type":"string","links":[]}],"properties":{"id":"7e222ef1-ee88-439f-8be6-6e53c17403aa","name":"case/report-tuproduksi","caption":"TU Produksi","is_backend":true,"is_frontend":false,"description":"","configuration":{"inputs":[{"name":"data","type":"array","link":12},{"name":"is_export","type":"boolean","link":17}],"outpu