 IS NULL THEN NULL ELSE ((x.AKHIR - x.AWAL) * 24) END AS TUKIN_DURASI FROM ( SELECT tu.rdistrik_kode, tu.rkunit_kode, tu.runit_kode, to_char(tu.tukin_tgl, 'YYYY-MM-DD') AS tukin_tgl, tu.tukin_jam, to_char(tu.tukin_tgl_end, 'YYYY-MM-DD') AS tukin_tgl_end, tu.tukin_jam_end, tu.rstatkin_kode, CONCAT(tu.RSTATKIN_KODE, CONCAT(' - ', rsk.RSTATKIN_NAMA)) AS RSTATKIN_KODE_NAMA, tu.rcc_kode, CONCAT(tu.RCC_KODE, CONCAT(' - ', rc.RCC_DESK)) AS RCC_KODE_NAMA, tu.tukin_derate, tu.sdof, tu.start_berhasil, tu.start_gagal, tu.verified, TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') AWAL, TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', COALESCE(tu.TUKIN_JAM_END, '00:00'))), 'yyyy-mm-dd hh24:mi') AS AKHIR FROM t_ukinerja tu LEFT JOIN R_STAT_KINERJA rsk ON rsk.RSTATKIN_KODE = tu.RSTATKIN_KODE LEFT JOIN R_CCODE rc ON rc.RCC_KODE = tu.RCC_KODE WHERE tu.RDISTRIK_KODE = :rdistrik_kode AND tu.RKUNIT_KODE = :rkunit_kode AND tu.RUNIT_KODE = :runit_kode AND ( ( TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') &lt;= to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') AND TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM_END)), 'yyyy-mm-dd hh24:mi') > to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') ) OR ( TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') &lt; add_months(to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI'), 1) AND TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM_END)), 'yyyy-mm-dd hh24:mi') > add_months(to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI'), 1) ) OR ( TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') >= to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') AND TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM_END)), 'yyyy-mm-dd hh24:mi') &lt;= add_months(to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI'), 1) ) OR ( TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') &lt;= to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') AND TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM_END)), 'yyyy-mm-dd hh24:mi') > add_months(to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI'), 1) ) ) ORDER BY tu.tukin_tgl OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY ) x WHERE x.AKHIR >= x.AWAL","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM ( SELECT tu.rdistrik_kode, tu.rkunit_kode, tu.runit_kode, to_char(tu.tukin_tgl, 'YYYY-MM-DD') AS tukin_tgl, tu.tukin_jam, to_char(tu.tukin_tgl_end, 'YYYY-MM-DD') AS tukin_tgl_end, tu.tukin_jam_end, tu.rstatkin_kode, CONCAT(tu.RSTATKIN_KODE, CONCAT(' - ', rsk.RSTATKIN_NAMA)) AS RSTATKIN_KODE_NAMA, tu.rcc_kode, CONCAT(tu.RCC_KODE, CONCAT(' - ', rc.RCC_DESK)) AS RCC_KODE_NAMA, tu.tukin_derate, tu.sdof, tu.start_berhasil, tu.start_gagal, tu.verified, TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') AWAL, TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1)), 'YYYY-MM-DD'), CONCAT(' ', COALESCE(tu.TUKIN_JAM_END, '00:00'))), 'yyyy-mm-dd hh24:mi') AS AKHIR FROM t_ukinerja tu LEFT JOIN R_STAT_KINERJA rsk ON rsk.RSTATKIN_KODE = tu.RSTATKIN_KODE LEFT JOIN R_CCODE rc ON rc.RCC_KODE = tu.RCC_KODE WHERE tu.RDISTRIK_KODE = :rdistrik_kode AND tu.RKUNIT_KODE = :rkunit_kode AND tu.RUNIT_KODE = :runit_kode AND ( ( TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyy