","runit_kode":"","tukin_tgl":"","limit":10,"offset":0},"sql":"SELECT x.*, CASE WHEN x.TUKIN_TGL_END IS NULL THEN NULL ELSE ((x.AKHIR - x.AWAL) * 24) END AS TUKIN_DURASI FROM ( SELECT tu.RDISTRIK_KODE, tu.RKUNIT_KODE, tu.RUNIT_KODE, TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD') AS TUKIN_TGL, tu.TUKIN_JAM, TO_CHAR(tu.TUKIN_TGL_END, 'YYYY-MM-DD') AS TUKIN_TGL_END, tu.TUKIN_JAM_END, tu.RSTATKIN_KODE, tu.RCC_KODE, TO_DATE(CONCAT(TO_CHAR(tu.TUKIN_TGL, 'YYYY-MM-DD'), CONCAT(' ', tu.TUKIN_JAM)), 'yyyy-mm-dd hh24:mi') AS AWAL, TO_DATE(CONCAT(TO_CHAR(COALESCE(tu.TUKIN_TGL_END, (TO_DATE(:tukin_tgl, 'YYYY-MM-DD') + 1)), 'YYYY-MM-DD'), CONCAT(' ', COALESCE(tu.TUKIN_JAM_END, '00:00'))), 'yyyy-mm-dd hh24:mi') AS AKHIR, CONCAT(tu.RSTATKIN_KODE, CONCAT(' - ', rsk.RSTATKIN_NAMA)) AS RSTATKIN_KODE_NAMA, CONCAT(tu.RCC_KODE, CONCAT(' - ', rc.RCC_DESK)) AS RCC_KODE_NAMA, tu.RWDATA_KODE, tu.RUSER_ID, tu.RSHIFT_KODE, tu.TUKIN_DERATE, tu.TUKIN_NOTES , TO_CHAR(tu.STATUS_TGL, 'YYYY-MM-DD') AS STATUS_TGL, tu.VERIFIED , tu.VERIFY_USER , tu.SDOF , tu.EQUIP_NO , tu.START_BERHASIL , tu.START_GAGAL FROM T_UKINERJA tu LEFT JOIN R_STAT_KINERJA rsk ON rsk.RSTATKIN_KODE = tu.RSTATKIN_KODE LEFT JOIN R_CCODE rc ON rc.RCC_KODE = tu.RCC_KODE WHERE tu.RDISTRIK_KODE = :rdistrik_kode AND tu.RKUNIT_KODE = :rkunit_kode AND tu.RUNIT_KODE = :runit_kode AND ((tu.TUKIN_TGL = TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END = TO_DATE(:tukin_tgl, 'YYYY-MM-DD')) OR (tu.TUKIN_TGL &lt;= TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END >= TO_DATE(:tukin_tgl, 'YYYY-MM-DD')) OR (tu.TUKIN_TGL &lt;= TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END IS NULL)) ORDER BY tu.TUKIN_TGL DESC OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY ) x;","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM T_UKINERJA tu WHERE tu.RDISTRIK_KODE = :rdistrik_kode AND tu.RKUNIT_KODE = :rkunit_kode AND tu.RUNIT_KODE = :runit_kode AND ((tu.TUKIN_TGL = TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END = TO_DATE(:tukin_tgl, 'YYYY-MM-DD')) OR (tu.TUKIN_TGL &lt;= TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END >= TO_DATE(:tukin_tgl, 'YYYY-MM-DD')) OR (tu.TUKIN_TGL &lt;= TO_DATE(:tukin_tgl, 'YYYY-MM-DD') AND tu.TUKIN_TGL_END IS NULL));"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":2,"type":"system/process","pos":[880,750],"size":{"0":210,"1":138},"flags":{},"order":8,"mode":0,"inputs":[{"name":"method","type":"string","link":34},{"name":"search","type":"string"},{"name":"query","type":"object","link":37},{"name":"body","type":"object","link":46},{"name":"file","type":"file","link":39}],"outputs":[{"name":"result","type":"object","links":[5]}],"properties":{"id":"d2a8e54d-178d-4f36-b16a-461fc39c68c4","name":"system/process","caption":"Process","is_backend":true,"is_frontend":false,"description":"System Process","configuration":{"inputs":[{"name":"method","type":"string","link":34},{"name":"search","type":"string"},{"name":"query","type":"object","link":37},{"name":"body","type":"object","link":46},{"name":"file","type":"file","link":39}],"outputs":[{"name":"result","type":"object","links":[5]}],"configuration":{"process_name":"process/oracle_crud","entity_name":"t_ukinerja","show_keys":1,"insert_keys":1,"optional":[],"default":{"rdistrik_kode":"","rkunit_kode":"","runit_kode":"","tukin_tgl":""},"import_fields":[{"key":"verified","header":"Verified"},{"key":"rdistrik_kode","header":"Kode Distrik"},{"key":"rkunit_kode","header":"Kode Entitas"},{"key":"runit_kode","header":"Kode Unit"},{"key":"tukin_tgl","header":"Tanggal Awal","type":"date"},{"key":"tukin_jam","header":"Jam Awal"},{"key":"tukin_tgl_end","header":"Tanggal Akhir","type":"date"},{"key":"tukin_jam_end","header":"Jam Akhir"},{"key":"tukin_durasi","header":"Durasi(Jam)"},{"key":"rstatkin_kode","header":"Kode Status Kinerja"},{"key":"rcc_kode","header":"Cause Code"},{"key":"tukin