concat('%', :runit_kode), '%') AND TUPROD_TGL BETWEEN to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') AND (add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1) - 1)) AS total_row, tub.RDISTRIK_KODE, tub.RKUNIT_KODE, tub.RUNIT_KODE, tub.TAHUN, tub.BULAN, rd.RDISTRIK_NAMA, rk.RKUNIT_NAMA, ru.RUNIT_NAMA, SUM(tub.GROSS) AS GROSS, SUM(tub.NET) AS NET, COALESCE(ru.RUNIT_GMC, 0) AS GMC, COALESCE(ru.RUNIT_NMC, 0) AS NMC FROM T_UPRODUKSI_BULANAN tub JOIN R_DISTRIK rd ON rd.RDISTRIK_KODE = tub.RDISTRIK_KODE JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tub.RDISTRIK_KODE AND rk.RKUNIT_KODE = tub.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = tub.RDISTRIK_KODE AND ru.RKUNIT_KODE = tub.RKUNIT_KODE AND ru.RUNIT_KODE = tub.RUNIT_KODE WHERE tub.RDISTRIK_KODE = :rdistrik_kode AND tub.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tub.RUNIT_KODE LIKE concat(concat('%', :runit_kode), '%') AND tub.BULAN = :bulan AND tub.TAHUN = :tahun AND ru.TIPE_NETTO &lt; 4 GROUP BY tub.RDISTRIK_KODE, tub.RKUNIT_KODE, tub.RUNIT_KODE, tub.BULAN, tub.TAHUN, rd.RDISTRIK_NAMA, rk.RKUNIT_NAMA, ru.RUNIT_NAMA, ru.RUNIT_GMC, ru.RUNIT_NMC ORDER BY tub.RUNIT_KODE OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY;","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM ( SELECT ( SELECT COUNT(*) FROM T_UPRODUKSI_HARIAN WHERE RDISTRIK_KODE = :rdistrik_kode AND RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND RUNIT_KODE LIKE concat(concat('%', :runit_kode), '%') AND TUPROD_TGL BETWEEN to_date(:tahun || :bulan || '00:00', 'YYYYMMHH24:MI') AND (add_months(to_date(:tahun || :bulan , 'YYYYMM'), 1) - 1)) AS total_row, tub.RDISTRIK_KODE, tub.RKUNIT_KODE, tub.RUNIT_KODE, tub.TAHUN, tub.BULAN, rd.RDISTRIK_NAMA, rk.RKUNIT_NAMA, ru.RUNIT_NAMA, SUM(tub.GROSS) AS GROSS, SUM(tub.NET) AS NET FROM T_UPRODUKSI_BULANAN tub JOIN R_DISTRIK rd ON rd.RDISTRIK_KODE = tub.RDISTRIK_KODE JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tub.RDISTRIK_KODE AND rk.RKUNIT_KODE = tub.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = tub