 JOIN R_UNIT ru ON ru.RDISTRIK_KODE = tub.RDISTRIK_KODE AND ru.RKUNIT_KODE = tub.RKUNIT_KODE AND ru.RUNIT_KODE = tub.RUNIT_KODE WHERE tub.RDISTRIK_KODE = :rdistrik_kode AND tub.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tub.RUNIT_KODE LIKE concat(concat('%', :runit_kode), '%') AND tub.BULAN = :bulan AND tub.TAHUN = :tahun AND ru.TIPE_NETTO &lt; 4 GROUP BY tub.RDISTRIK_KODE, tub.RKUNIT_KODE, tub.RUNIT_KODE, tub.BULAN, tub.TAHUN, rd.RDISTRIK_NAMA, rk.RKUNIT_NAMA, ru.RUNIT_NAMA ORDER BY tub.RUNIT_KODE OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY;","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM T_UPRODUKSI_BULANAN tub JOIN R_DISTRIK rd ON rd.RDISTRIK_KODE = tub.RDISTRIK_KODE JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tub.RDISTRIK_KODE AND rk.RKUNIT_KODE = tub.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = tub.RDISTRIK_KODE AND ru.RKUNIT_KODE = tub.RKUNIT_KODE AND ru.RUNIT_KODE = tub.RUNIT_KODE WHERE tub.RDISTRIK_KODE = :rdistrik_kode AND tub.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tub.RUNIT_KODE LIKE concat(concat('%', :runit_kode), '%') AND tub.BULAN = :bulan AND tub.TAHUN = :tahun AND ru.TIPE_NETTO &lt; 4 GROUP BY tub.RDISTRIK_KODE, tub.RKUNIT_KODE, tub.RUNIT_KODE, tub.BULAN, tub.TAHUN, rd.RDISTRIK_NAMA, rk.RKUNIT_NAMA, ru.RUNIT_NAMA"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":4,"type":"system/data_map","pos":[10,510],"size":{"0":210,"1":218},"flags":{},"order":1,"mode":0,"inputs":[{"name":"query","type":"object","link":3}],"outputs":[{"name":"is_export","type":"boolean","links":[55]},{"name":"rdistrik_kode","type":"string","links":[23,28,39]},{"name":"rkunit_kode","type":"string","links":[24,29,40]},{"name":"runit_kode","type":"string","links":[25,30,41]},{"name":"tahun","type":"string","links":[26,31,42]},{"name":"bulan","type":"string","links":[27,32,43]},{"name"