kin_tgl_harian, COALESCE(k.sdof, 0) as sdof, COALESCE(k.banyak_po, 0) as banyak_po, COALESCE(k.banyak_mo, 0) as banyak_mo, COALESCE(k.banyak_fo, 0) as banyak_fo, COALESCE(k.nshrs, 0) as nshrs, COALESCE(k.sdhrs, 0) as sdhrs, COALESCE(k.fdhrs, 0) as fdhrs, COALESCE(k.esdhrs, 0) as esdhrs, COALESCE(k.efdhrs, 0) as efdhrs, COALESCE(k.pdh, 0) as pdh, COALESCE(k.fdh, 0) as fdh, COALESCE(k.mdh, 0) as mdh, COALESCE(k.epdh, 0) as epdh, COALESCE(k.efdh, 0) as efdh, COALESCE(k.emdh, 0) as emdh, COALESCE(k.poh, 0) as poh, COALESCE(k.moh, 0) as moh, COALESCE(k.foh, 0) as foh, COALESCE(k.noh, 0) as noh, COALESCE(k.eaf, 0) as eaf, COALESCE(k.efor, 0) as efor, COALESCE(k.sof, 0) as sof, k.x_omc, u.runit_nama, rk.rkunit_nama, rd.rdistrik_nama, COALESCE(k.sh, 0) as sh, COALESCE(k.ph, 0) as ph, COALESCE(k.ah, 0) as ah, COALESCE(k.derating, 0) as derating, COALESCE(k.dmn, 0) as dmn FROM kinerja_harian k JOIN r_unit u ON k.rdistrik_kode = u.rdistrik_kode AND k.rkunit_kode = u.rkunit_kode AND k.runit_kode = u.runit_kode JOIN r_kunit rk ON k.rdistrik_kode = rk.rdistrik_kode AND k.rkunit_kode = rk.rkunit_kode JOIN r_distrik rd ON k.rdistrik_kode = rd.rdistrik_kode WHERE k.rdistrik_kode = :rdistrik_kode AND k.rkunit_kode LIKE CONCAT(CONCAT('%', :rkunit_kode), '%') AND k.runit_kode LIKE CONCAT(CONCAT('%', :runit_kode), '%') AND k.tukin_tgl BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND k.x_omc IN (:x_omc) ORDER BY k.rdistrik_kode, k.rkunit_kode, k.runit_kode, k.tukin_tgl, k.x_omc OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY;","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM kinerja_harian where rdistrik_kode =:rdistrik_kode and rkunit_kode like concat(concat('%', :rkunit_kode), '%') and tukin_tgl BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND x_omc IN (:x_omc) "}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b