ame":"to_date","type":"string","link":7},{"name":"limit","type":"number","link":8},{"name":"offset","type":"number","link":13},{"name":"scr_kode","type":"string","link":14}],"outputs":[{"name":"dataset","type":"array","links":[9]},{"name":"pagination","type":"object","links":[2]}],"configuration":{"optional":[],"default":{"rdistrik_kode":"","rkunit_kode":"","rfoc_kode":"","from_date":"","to_date":"","limit":10,"offset":0},"sql":"SELECT * FROM ( SELECT tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, rk.RKUNIT_NAMA, tbh.RFOC_KODE, SUM(tbh.PENERIMAAN) AS PENERIMAAN, SUM(tbh.PEMAKAIAN) AS PEMAKAIAN, SUM(tbh.PERSEDIAAN_CALC * tbh.KALOR_CALC) / SUM(tbh.PERSEDIAAN_CALC) AS KALOR_CALC, SUM(tbh.PERSEDIAAN_CALC * tbh.HARGA_CALC) / SUM(tbh.PERSEDIAAN_CALC) AS HARGA_CALC FROM T_BBM_HARIAN tbh JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tbh.RDISTRIK_KODE AND rk.RKUNIT_KODE = tbh.RKUNIT_KODE WHERE tbh.RDISTRIK_KODE = :rdistrik_kode AND tbh.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tbh.TBBM_TGL BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND tbh.RFOC_KODE = :rfoc_kode GROUP BY tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, rk.RKUNIT_NAMA, tbh.RFOC_KODE ORDER BY tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, tbh.RFOC_KODE OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY ) x, ( SELECT tbh.PERSEDIAAN_CALC_PREV FROM T_BBM_HARIAN tbh JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tbh.RDISTRIK_KODE AND rk.RKUNIT_KODE = tbh.RKUNIT_KODE WHERE tbh.RDISTRIK_KODE = :rdistrik_kode AND tbh.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tbh.TBBM_TGL BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND tbh.RFOC_KODE = :rfoc_kode ORDER BY tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, tbh.RFOC_KODE, tbh.TBBM_TGL ASC OFFSET :offset ROWS FETCH NEXT 1 ROWS ONLY ) y, ( SELECT tbh.PERSEDIAAN_CALC, tbh.PERSEDIAAN FROM T_BBM_HARIAN tbh JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tbh.RDISTRIK_KODE AND rk.RKUNIT_KODE = tbh.RKUNIT_KODE WHERE tbh.RDISTRIK_KODE = :rdistrik_kode AND tbh.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tbh.TBBM_TGL BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND tbh.RFOC_KODE = :rfoc_kode ORDER BY tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, tbh.RFOC_KODE, tbh.TBBM_TGL DESC OFFSET :offset ROWS FETCH NEXT 1 ROWS ONLY ) z","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM T_BBM_HARIAN tbh JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = tbh.RDISTRIK_KODE AND rk.RKUNIT_KODE = tbh.RKUNIT_KODE WHERE tbh.RDISTRIK_KODE = :rdistrik_kode AND tbh.RKUNIT_KODE LIKE concat(concat('%', :rkunit_kode), '%') AND tbh.TBBM_TGL BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND tbh.RFOC_KODE = :rfoc_kode GROUP BY tbh.RDISTRIK_KODE, tbh.RKUNIT_KODE, rk.RKUNIT_NAMA, tbh.RFOC_KODE"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]}],"links":[[2,3,1,4,0,"object"],[3,2,1,3,0,"string"],[4,2,2,3,1,"string"],[5,2,3,3,2,"string"],[6,2,4,3,3,"string"],[7,2,5,3,4,"number"],[8,2,6,3,5,"number"],[9,3,0,5,0,"array"],[12,5,0,7,0,"array"],[13,2,7,3,6,"number"],[14,9,0,3,7,"string"],[60,1,0,2,0,"object"],[61,5,0,19,1,"array"],[62,2,0,19,0,"boolean"]],"groups":[],"config":{},"extra":{},"version":0.4}	{"inputs":[{"name":"query","type":"object"}],"outputs":[{"name":"result","type":"array"}]}	2023-06-15 11:28:08.54+00	2023-06-17 07:36:41.53+00	279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8	{5cd24069-19b9-4443-b179-b3d1ca034f83,2db5452a-25ca-4d95-a566-abee2568952c,ca4aa927-3733-457a-9cfe-fb18061582cc,5cd24069-19b9-4443-b179-b3d1ca034f83,6b6fe097-ec36-4235-9268-f34acf7c09b8,bfb220cb-3ffc-428f-96c6-34690c9f46c9,7a11d802-5e4b-4475-8896-398ce1703741,9e05c67e-10de-49e7-afc2-d47beaa3b9db}	t	f
