_kode AND tuwater_tgl BETWEEN TO_DATE(TRUNC(TO_DATE(:tahun ||'-'|| :bulan, 'YYYY-MM'), 'MONTH')) + 1 AND LAST_DAY(TO_DATE(:tahun ||'-'|| :bulan, 'YYYY-MM')) GROUP BY rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(tuwater_tgl, 'YYYY-MM-DD'), verified UNION SELECT rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(TO_DATE(:tahun ||'-'|| :bulan || '-01', 'YYYY-MM-DD'), 'YYYY-MM-DD') AS tuwater_tgl, SUM(makeup_water) AS makeup_water, SUM(stand_pipe) AS stand_pipe, SUM(service_usage) AS service_usage, verified from t_uwater WHERE rdistrik_kode = :rdistrik_kode AND rkunit_kode = :rkunit_kode AND TO_CHAR(TO_DATE(tuwater_tgl), 'YYYY-MM-DD') || ' ' || TO_CHAR(TO_DATE(tuwater_jam, 'HH24:MI'), 'HH24:MI') BETWEEN TO_CHAR(TO_DATE(:tahun ||'-'|| :bulan || '-01', 'YYYY-MM-DD'), 'YYYY-MM-DD') || ' ' || TO_CHAR(TO_DATE('10:01', 'HH24:MI'), 'HH24:MI') AND TO_CHAR(TO_DATE(:tahun ||'-'|| :bulan || '-02', 'YYYY-MM-DD'), 'YYYY-MM-DD') || ' ' || TO_CHAR(TO_DATE('00:00', 'HH24:MI'), 'HH24:MI') GROUP BY rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(TO_DATE(:tahun ||'-'|| :bulan || '-01', 'YYYY-MM-DD'), 'YYYY-MM-DD'), verified UNION SELECT rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(tuwater_tgl, 'YYYY-MM-DD') AS tuwater_tgl, SUM(makeup_water) AS makeup_water, SUM(stand_pipe) AS stand_pipe, SUM(service_usage) AS service_usage, verified from t_uwater WHERE rdistrik_kode = :rdistrik_kode AND rkunit_kode = :rkunit_kode AND tuwater_tgl = ADD_MONTHS(TRUNC(TO_DATE(:tahun ||'-'|| :bulan, 'YYYY-MM'), 'MONTH'), 1) AND tuwater_jam BETWEEN '00:01' AND '10:00' GROUP BY rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(tuwater_tgl, 'YYYY-MM-DD'), verified) ORDER BY tuwater_tgl DESC OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY","sql_count":"SELECT COUNT(*) AS \\"row_count\\" FROM (SELECT rdistrik_kode, rkunit_kode, runit_kode, TO_CHAR(tuwater_tgl, 'YYYY-MM-DD') AS tuwater_tgl, SUM(makeup_water) AS makeup_water, SUM(stand_pipe) AS stand_pipe, SUM(service_usage) AS service_usage, verified FROM t_uwater_