t_kode":"","runit_kode":"","x_omc":["0","1"],"from_date":"","to_date":"","limit":10,"offset":0},"sql":"SELECT kb.rdistrik_kode, kb.rkunit_kode, kb.runit_kode, ru.runit_nama, rk.rkunit_nama, rd.rdistrik_nama, kb.x_omc,LISTAGG(TO_CHAR(kb.tukin_tgl, 'YYYY-MM-DD'), ', ') WITHIN GROUP (ORDER BY kb.tukin_tgl) AS tukin_tgl_range, NVL(SUM(kb.sdof), 0) AS total_sdof, NVL(SUM(kb.banyak_po), 0) AS total_banyak_po, NVL(SUM(kb.banyak_mo), 0) AS total_banyak_mo, NVL(SUM(kb.banyak_fo), 0) AS total_banyak_fo, NVL(SUM(kb.nshrs), 0) AS total_nshrs, NVL(SUM(kb.sdhrs), 0) AS total_sdhrs, NVL(SUM(kb.fdhrs), 0) AS total_fdhrs, NVL(SUM(kb.fdh), 0) AS total_fdh, NVL(SUM(kb.esdhrs), 0) AS total_esdhrs, NVL(SUM(kb.efdh), 0) AS total_efdh, NVL(SUM(kb.efdhrs), 0) AS total_efdhrs, NVL(SUM(kb.emdh), 0) AS total_emdh, NVL(SUM(kb.mdh), 0) AS total_mdh, NVL(SUM(kb.poh),0) AS total_poh, NVL(SUM(kb.moh), 0) AS total_moh, NVL(SUM(kb.foh), 0) AS total_foh, NVL(SUM(kb.noh), 0) AS total_noh, NVL(AVG(kb.eaf), 0) AS total_eaf, NVL(AVG(kb.efor), 0) AS total_efor, NVL(AVG(kb.sof), 0) AS total_sof, NVL(SUM(kb.pdh), 0) AS total_pdh, NVL(SUM(kb.epdh), 0) AS total_epdh, NVL(SUM(kb.sh), 0) AS sh, NVL(SUM(kb.ph), 0) AS ph, NVL(SUM(kb.ah), 0) AS ah, NVL(SUM(kb.derating), 0) AS derating, NVL(AVG(kb.dmn), 0) AS dmn FROM kinerja_harian kb JOIN r_unit ru ON kb.rdistrik_kode = ru.rdistrik_kode AND kb.rkunit_kode = ru.rkunit_kode AND kb.runit_kode = ru.runit_kode JOIN r_kunit rk ON kb.rdistrik_kode = rk.rdistrik_kode AND kb.rkunit_kode = rk.rkunit_kode JOIN r_distrik rd ON kb.rdistrik_kode = rd.rdistrik_kode WHERE kb.rdistrik_kode = :rdistrik_kode AND kb.rkunit_kode LIKE CONCAT(CONCAT('%', :rkunit_kode), '%') AND kb.runit_kode LIKE CONCAT(CONCAT('%', :runit_kode), '%') AND kb.tukin_tgl BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') AND kb.x_omc IN (:x_omc) GROUP BY kb.rdistrik_kode, kb.rkunit_kode, kb.runit_kode, ru.runit_nama, rk.rkunit_nama, rd.rdistrik_nama, kb.x_omc ORDER BY kb.rdistrik