_query","caption":"SQL Query","is_backend":true,"is_frontend":false,"description":"SQL Query","configuration":{"inputs":[{"name":"data","type":"object","link":22}],"outputs":[{"name":"dataset","type":"object","links":[16]}],"configuration":{"param_mode":"data_object","sql":"SELECT rd.rkunit_kode AS kode, rd.rkunit_nama AS nama, rd.LONGITUDE, rd.LATITUDE, b.mw, coalesce(c.status, 0) AS status FROM r_kunit rd  LEFT JOIN  ( SELECT rkunit_kode, sum(tubeban_mw) AS mw FROM    (     SELECT RDISTRIK_KODE, RKUNIT_KODE, RUNIT_KODE, TUBEBAN_MW, TUBEBAN_MVAR, TUBEBAN_TGL, TUBEBAN_JAM,        row_number() OVER (PARTITION BY RDISTRIK_KODE, RKUNIT_KODE, RUNIT_KODE ORDER BY TUBEBAN_TGL DESC, TUBEBAN_JAM DESC) RN \\tFROM T_UBEBAN tu \\tWHERE RDISTRIK_KODE = :rdistrik_kode \\t) WHERE RN = 1   GROUP BY rkunit_kode  ) b ON rd.rkunit_kode = b.rkunit_kode LEFT JOIN  (   SELECT rkunit_kode, max(tu.RSTATKIN_KODE) AS RSTATKIN_KODE, count(*) AS jumlah, 1 AS status   FROM T_UKINERJA tu    WHERE TUKIN_TGL_END IS NULL   GROUP BY rkunit_kode  ) c ON rd.rkunit_kode = c.rkunit_kode WHERE rd.RDISTRIK_KODE = :rdistrik_kode AND rd.LONGITUDE IS NOT NULL AND rd.LATITUDE IS NOT NULL   AND abs(rd.LONGITUDE)&lt;=180 AND abs(rd.LATITUDE)&lt;=90"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":7,"type":"database/sql_query","pos":[1320,470],"size":{"0":210,"1":58},"flags":{},"order":5,"mode":0,"inputs":[{"name":"data","type":"object","link":23}],"outputs":[{"name":"dataset","type":"object","links":[17]}],"properties":{"id":"9e05c67e-10de-49e7-afc2-d47beaa3b9db","name":"database/sql_query","caption":"SQL Query","is_backend":true,"is_frontend":false,"description":"SQL Query","configuration":{"inputs":[{"name":"data","type":"object","link":23}],"outputs":[{"name":"dataset","type":"object","links":[17]}],"configuration":{"param_mode":"data_object","sql":"SELECT rd.runit_kode AS kode, rd.runit_nama AS nama, rd.LONGITUDE, rd.LATITUDE, b.mw, coalesce(c.status, 0) AS status FROM r_unit rd  LEFT JOIN  ( SELECT runit_kode, sum(tubeban_mw) AS mw FROM    (     SELECT RDISTRIK_KODE, RKUNIT_KODE, RUNIT_KODE, TUBEBAN_MW, TUBEBAN_MVAR, TUBEBAN_TGL, TUBEBAN_JAM,        row_number() OVER (PARTITION BY RDISTRIK_KODE, RKUNIT_KODE, RUNIT_KODE ORDER BY TUBEBAN_TGL DESC, TUBEBAN_JAM DESC) RN \\tFROM T_UBEBAN tu \\tWHERE RDISTRIK_KODE = :rdistrik_kode AND RKUNIT_KODE = :rkunit_kode \\t) WHERE RN = 1   GROUP BY runit_kode  ) b ON rd.runit_kode = b.runit_kode LEFT JOIN  (   SELECT runit_kode, max(tu.RSTATKIN_KODE) AS RSTATKIN_KODE, count(*) AS jumlah, 1 AS status   FROM T_UKINERJA tu    WHERE TUKIN_TGL_END IS NULL   GROUP BY runit_kode  ) c ON rd.runit_kode = c.runit_kode WHERE rd.RDISTRIK_KODE = :rdistrik_kode AND rd.RKUNIT_KODE = :rkunit_kode AND rd.LONGITUDE IS NOT NULL AND rd.LATITUDE IS NOT NULL   AND abs(rd.LONGITUDE)&lt;=180 AND abs(rd.LATITUDE)&lt;=90"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":5,"type":"database/sql_query","pos":[1300,70],"size":{"0":210,"1":58},"flags":{},"order":3,"mode":0,"inputs":[{"name":"filter","type":"object","link":27}],"outputs":[{"name":"dataset","type":"object","links":[15]}],"properties":{"id":"9e05c67e-10de-49e7-afc2-d47beaa3b9db","name":"database/sql_query","caption":"SQL Query","is_backend":true,"is_frontend":false,"description":"SQL Query","configuration":{"inputs":[{"name":"filter","type":"object","link":27}],"outputs":[{"name":"dataset","type":"object","links":[15]}],"configuration":{"sql":"SELECT    rd.RDISTRIK_KODE AS kode,    rd.RDISTRIK_NAMA AS nama,    rd.LONGITUDE,    rd.LATITUDE,    b.mw,    d.nmc/1000 as nmc,   coalesce(c.status, 0) AS status  FROM    R_DISTRIK rd    LEFT JOIN (     SELECT        rdistrik_kode,        sum(tubeban_mw) AS mw      FROM        (         SELECT            RDISTRIK_KODE,            RKUNIT_KODE,            RUNIT_KODE,            TUBEBAN_MW,            TUBEBAN_MVAR,            TUBEBAN_TGL,            TUBEBAN_JAM,            row_number() OVER (             PARTITION BY RDISTRIK_KODE,              RKUNIT_KODE,              RUNIT_KODE              ORDER BY                TUBEBAN_TGL DESC,                TUBEBAN_JAM DESC           ) RN          FROM            T_UBEBAN tu       )      WHERE        RN = 1      GROUP BY        RDISTRIK_KODE   ) b ON rd.RDISTRIK_KODE = b.rdistrik_kode    LEFT JOIN (     SELECT        rdistrik_kode,        max(tu.RSTATKIN_KODE) AS RSTATKIN_KODE,        count(*) AS jumlah,        1 AS status      FROM        T_UKINERJA tu      WHERE        TUKIN_TGL_END IS NULL      GROUP BY        RDISTRIK_KODE   ) c ON rd.RDISTRIK_KODE = c.rdistrik_kode    LEFT JOIN (     SELECT        rdistrik_kode,        sum(ru.RUNIT_NMC) AS nmc,        count(*) AS jumlah     FROM        r_unit ru     WHERE ru.RUNIT_NMC IS NOT null     GROUP BY        RDISTRIK_KODE   ) d ON rd.RDISTRIK_KODE = d.rdistrik_kode  WHERE    rd.LONGITUDE IS NOT NULL    AND rd.LATITUDE IS NOT NULL    AND abs(rd.LONGITUDE)&lt;= 180    AND abs(rd.LATITUDE)&lt;= 90"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]}],"links":[[4,1,0,2,0,"string"],[5,1,1,2,1,"string"],[10,1,3,2,2,"object"],[15,5,0,8,0,"object"],[16,6,0,9,0,"object"],[17,7,0,10,0,"object"],[18,8,0,11,0,"object"],[19,9,0,12,0,"object"],[20,10,0,13,0,"object"],[22,3,0,6,0,"object"],[23,3,1,7,0,"object"],[25,2,0,3,0,"string"],[26,2,1,3,1,"object"],[27,2,2,5,0,"object"]],"groups":[],"config":{},"extra":{},"version":0.4}	{}	2023-03-15 16:08:17.243+00	2023-04-01 16:29:14.73+00	279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8	{5cd24069-19b9-4443-b179-b3d1ca034f83,6b6fe097-ec36-4235-9268-f34acf7c09b8,5c