"database/sql_query","pos":[210,160],"size":{"0":210,"1":178},"flags":{},"order":2,"mode":0,"inputs":[{"name":"rdistrik_kode","type":"string","link":16},{"name":"rkunit_kode","type":"string","link":17},{"name":"runit_kode","type":"string","link":18},{"name":"tanggal_awal","type":"string","link":19},{"name":"tanggal_akhir","type":"string","link":20},{"name":"limit","type":"number","link":21},{"name":"offset","type":"number","link":22}],"outputs":[{"name":"dataset","type":"array","links":[3]},{"name":"pagination","type":"object","links":[14]}],"properties":{"id":"9e05c67e-10de-49e7-afc2-d47beaa3b9db","name":"database/sql_query","caption":"SQL Query","is_backend":true,"is_frontend":false,"description":"SQL Query","configuration":{"inputs":[{"name":"rdistrik_kode","type":"string","link":16},{"name":"rkunit_kode","type":"string","link":17},{"name":"runit_kode","type":"string","link":18},{"name":"tanggal_awal","type":"string","link":19},{"name":"tanggal_akhir","type":"string","link":20},{"name":"limit","type":"number","link":21},{"name":"offset","type":"number","link":22}],"outputs":[{"name":"dataset","type":"array","links":[3]},{"name":"pagination","type":"object","links":[14]}],"configuration":{"default":{"rkunit_kode":"","runit_kode":"","tanggal_awal":"","tanggal_akhir":"","limit":10,"offset":0},"sql":"select x.*, CASE WHEN x.TUKIN_TGL_END IS NULL THEN NULL ELSE ((x.AKHIR - x.AWAL) * 24) END AS TUKIN_DURASI from (select TO_DATE(CONCAT(TO_CHAR(a.tukin_tgl, 'YYYY-MM-DD'), CONCAT(' ', a.tukin_jam)), 'yyyy-mm-dd hh24:mi') AS AWAL, CASE WHEN a.tukin_tgl_end IS NULL THEN NULL ELSE TO_DATE(CONCAT(TO_CHAR(a.tukin_tgl_end, 'YYYY-MM-DD'), CONCAT(' ', a.tukin_jam_end)), 'yyyy-mm-dd hh24:mi') END AS AKHIR, to_char(a.tukin_tgl, 'YYYY-MM-DD') as tukin_tgl, a.tukin_jam, to_char(a.tukin_tgl_end, 'YYYY-MM-DD') as tukin_tgl_end, a.tukin_jam_end, a.rstatkin_kode, CONCAT(a.rstatkin_kode, CONCAT(' - ', b.rstatkin_nama)) as rstatkin_kode_nama, a.rcc_kode, CONCAT(a.rcc_kode, CONCAT(' - ', c.rcc_desk)) as rcc_kode_nama, a.tukin_derate, a.sdof, a.tukin_notes, a.rdistrik_kode, a.rkunit_kode, rk.rkunit_nama, rd.rdistrik_nama, a.runit_kode, u.runit_nama, b.rstatkin_kode || ' - ' || trim(b.rstatkin_nama) as rstatkin_nama from t_ukinerja a JOIN r_unit u ON a.runit_kode = u.runit_kode AND a.rkunit_kode = u.rkunit_kode AND a.rdistrik_kode = u.rdistrik_kode JOIN r_kunit rk ON a.rkunit_kode = rk.rkunit_kode AND a.rdistrik_kode = rk.rdistrik_kode JOIN r_distrik rd ON a.rdistrik_kode = rd.rdistrik_kode left join r_stat_kinerja b on a.rstatkin_kode = b.rstatkin_kode left join r_ccode c on a.rcc_kode = c.rcc_kode where a.rdistrik_kode = :rdistrik_kode and a.rkunit_kode LIKE concat(concat('%',:rkunit_kode),'%') and a.runit_kode LIKE concat(concat('%',:runit_kode),'%') and a.tukin_tgl between to_date(:tanggal_awal, 'YYYY-MM-DD') and to_date(:tanggal_akhir, 'YYYY-MM-DD') order by tukin_tgl, tukin_jam OFFSET :offset ROWS FETCH NEXT :limit ROWS ONLY) x;","sql_count":"SELECT COUNT(*) AS \\"row_count\\" from t_ukinerja a left join r_stat_kinerja b on a.rstatkin_kode = b.rstatkin_kode left join r_ccode c on a.rcc_kode = c.rcc_kode where rdistrik_kode = :rdistrik_kode and a.rkunit_kode LIKE concat(concat('%',:rkunit_kode),'%') and a.runit_kode LIKE concat(concat('%',:runit_kode),'%')  and tukin_tgl between to_date(:tanggal_awal, 'YYYY-MM-DD') and to_date(:tanggal_akhir, 'YYYY-MM-DD')"}},"module_name":"database/sql_query","createdAt":"2022-12-15T01:22:35.053Z","updatedAt":"2022-12-15T01:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]},{"id":12,"type":"report/generic","pos":[860,560],"size":{"0":210,"1":98},"flags":{},"order":6,"mode":0,"inputs":[{"name":"is_export","type":"boolean","link":35},{"name":"options","type":"object","link":32},{"name":"dataset","type":"array","link":31}],"outputs":[{"name":"result","type":"array"}],"properties":{"id":"f4998265-0179-42f9-9fbd-e28f758aac48","name":"report/generic","caption":"Report Generi