30, ir.H_04_00, ir.H_04_30, ir.H_05_00, ir.H_05_30, ir.H_06_00, ir.H_06_30, ir.H_07_00 , ir.H_07_30, ir.H_08_00, ir.H_08_30, ir.H_09_00, ir.H_09_30, ir.H_10_00, ir.H_10_30, ir.H_11_00, ir.H_11_30, ir.H_12_00, ir.H_12_30, ir.H_13_00 , ir.H_13_30, ir.H_14_00, ir.H_14_30, ir.H_15_00, ir.H_15_30, ir.H_16_00, ir.H_16_30, ir.H_17_00, ir.H_17_30, ir.H_18_00, ir.H_18_30, ir.H_19_00 , ir.H_19_30, ir.H_20_00, ir.H_20_30, ir.H_21_00, ir.H_21_30, ir.H_22_00, ir.H_22_30, ir.H_23_00, ir.H_23_30, ir.H_24_00 FROM INTEGRATION_RENCANA ir JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = ir.RDISTRIK_KODE AND rk.RKUNIT_KODE = ir.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = ir.RDISTRIK_KODE AND ru.RKUNIT_KODE = ir.RKUNIT_KODE AND ru.RUNIT_KODE = ir.RUNIT_KODE JOIN R_DISTRIK rd ON rd.RDISTRIK_KODE = ir.RDISTRIK_KODE WHERE ir.RDISTRIK_KODE = :rdistrik_kode AND ir.RKUNIT_KODE = :rkunit_kode AND ir.RUNIT_KODE LIKE CONCAT(CONCAT('%', :runit_kode), '%')  AND ir.DATE_ BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') ORDER BY ir.RUNIT_KODE ASC, ir.DATE_, ir.RDISTRIK_KODE, ir.RKUNIT_KODE OFFSET (:offset / 2) ROWS FETCH NEXT (:limit / 2) ROWS ONLY;","sql_count":"SELECT ( SELECT COUNT(*) AS rcount FROM INTEGRATION_RENCANA ir JOIN R_KUNIT rk ON rk.RDISTRIK_KODE = ir.RDISTRIK_KODE AND rk.RKUNIT_KODE = ir.RKUNIT_KODE JOIN R_UNIT ru ON ru.RDISTRIK_KODE = ir.RDISTRIK_KODE AND ru.RKUNIT_KODE = ir.RKUNIT_KODE AND ru.RUNIT_KODE = ir.RUNIT_KODE JOIN R_DISTRIK rd ON rd.RDISTRIK_KODE = ir.RDISTRIK_KODE WHERE ir.RDISTRIK_KODE = :rdistrik_kode AND ir.RKUNIT_KODE = :rkunit_kode AND ir.RUNIT_KODE LIKE CONCAT(CONCAT('%', :runit_kode), '%')  AND ir.DATE_ BETWEEN TO_DATE(:from_date, 'YYYY-MM-DD') AND TO_DATE(:to_date, 'YYYY-MM-DD') ) * 2 AS \\"row_count\\" FROM dual"}},"module_name":"database/sql_query","createdAt":"2022-12-15T08:22:35.053Z","updatedAt":"2022-12-15T08:33:13.338Z","meta_application_id":"279aa6a1-7cc1-4c1b-b9db-1bbca99ffed8"},"widgets_values":[""]}],"links":[[3,3,0,4,0,"object"],